import React, { useState } from "react";
import IndexProjects from "../components/Project/IndexProjects";
import CreateProject from "../components/Project/CreateProject";
import Button from "../utils/Button";
import IndexTimeregistrations from "../components/Timeregistration/IndexTimeregistrations";

export default function TimeloggerHomePage() {
    
    const [searchTerm, setSearchTerm] = useState("");
    const [showCreateProject, setShowCreateProject] = useState(false);

    const handleAddProject = () => {
        setShowCreateProject(true);
    };

    const handleSearch = (e: React.FormEvent<HTMLFormElement>) => {
        e.preventDefault();
        // Implement search logic
        // For now, let's just re-fetch all projects without filtering
        //fetchProjects();
    };

    const handleSearchChange = (e: React.ChangeEvent<HTMLInputElement>) => {
        setSearchTerm(e.target.value);
    };

    return (
        <>
            <div className="flex items-center my-6">
                <div className="w-1/2">
                <Button  className="bg-blue-500 hover:bg-blue-700 text-black font-bold py-2 px-4 rounded" 
                         onClick={() => setShowCreateProject(true)}> Add Project
                </Button>   
                </div>
                {showCreateProject && <CreateProject onProjectCreated={function (): void {
                    setShowCreateProject(false);
                } } />}

                <div className="w-1/2">
                    <Button className="bg-green-500 hover:bg-green-700 text-black font-bold py-2 px-4 rounded" onClick={handleAddProject}>
                        Create TimeRegistration
                    </Button>
                </div>

                <div className="w-1/2 flex justify-end">
                    <form onSubmit={handleSearch}>
                        <input
                            className="border rounded-full py-2 px-4"
                            type="search"
                            placeholder="Search"
                            aria-label="Search"
                            value={searchTerm}
                            onChange={handleSearchChange}
                        />
                        <Button
                            className="bg-blue-500 hover:bg-blue-700 text-black rounded-full py-2 px-4 ml-2"
                            type="submit"
                        >
                            Search
                        </Button>
                    </form>
                </div>
            </div>
            <IndexProjects  />
            <IndexTimeregistrations  />
        </>
    );
}
